MZ = [[0.7310,0.4814,0.6908,0.4326,0.1753,0.8567,0.8665,0.6107] [0.7010,0.5814,0.3908,0.1326,0.4153,0.7567,0.8565,0.5107] [0.2010,0.6814,0.1908,0.4326,0.8153,0.7567,0.6565,0.7107]]
T = 8

function master_plus_RCYZ(MY, MZ)
    œÖ = JumpModel(0) # The master problem = 1st stage + RO
    JuMP.@variable(œÖ, u[1:T, 2:G], Bin)
    JuMP.@variable(œÖ, v[1:T, 2:G], Bin)
    JuMP.@variable(œÖ, x[0:T, 2:G], Bin)
    JuMP.@expression(œÖ, CGst[t = 1:T, g = 2:G], G‚Ñ∂["CST"][g] * u[t, g])
    JuMP.@expression(œÖ, CGsh[t = 1:T, g = 2:G], G‚Ñ∂["CSH"][g] * v[t, g])
    JuMP.@expression(œÖ, COST1, sum(CGst) + sum(CGsh))
    JuMP.@constraint(œÖ, [t = 1:T, g = 2:G], x[t, g] - x[t-1, g] == u[t, g] - v[t, g]) # linking constr, but authentic 1st stage
    [   JuMP.fix(x[0, g], G‚Ñ∂["ZS"][g]; force = true) for g in 2:G   ]
    JuMP.@constraint(œÖ, [g = 2:G, t = 1:T-G‚Ñ∂["UT"][g]+1], sum(x[i, g] for i in t:t+G‚Ñ∂["UT"][g]-1) >= G‚Ñ∂["UT"][g] * u[t, g])
    JuMP.@constraint(œÖ, [g = 2:G, t = T-G‚Ñ∂["UT"][g]+1:T], sum(x[i, g] - u[t, g] for i in t:T) >= 0.)
    JuMP.@constraint(œÖ, [g = 2:G, t = 1:T-G‚Ñ∂["DT"][g]+1], sum(1. - x[i, g] for i in t:t+G‚Ñ∂["DT"][g]-1) >= G‚Ñ∂["DT"][g] * v[t, g])
    JuMP.@constraint(œÖ, [g = 2:G, t = T-G‚Ñ∂["DT"][g]+1:T], sum(1. - x[i, g] - v[t, g] for i in t:T) >= 0.)
    # D1 = cutDict1
    # for (pu, pv, px, cn, ut, vt, xt) in zip(D1["pu"], D1["pv"], D1["px"], D1["cn"], D1["u"], D1["v"], D1["x"])
    #     JuMP.@constraint(œÖ, 0. >= cn + ip(pu, u .- ut) + ip(pv, v .- vt) + ip(px, x .- xt)) # Feas. cut
    # end
    # RCY's part
    JuMP.@variable(œÖ, Œ±)
    JuMP.@variable(œÖ, Œ≤Y[1:T, 1:W])
    JuMP.@variable(œÖ, Œ≤Z[1:T, 1:L])
    JuMP.@variable(œÖ, objterm)
    JuMP.@constraint(œÖ, objterm >= COST1 + Œ± + ip(MY, Œ≤Y) + ip(MZ, Œ≤Z)) # üìï joint optimization
    JuMP.@objective(œÖ, Min, objterm) 
    K = length(YZcrew)
    if true # second-stage variables
        JuMP.@variable(œÖ, œñ[1:K, 1:T, 1:W] >= 0.)
        JuMP.@variable(œÖ, Œ∂[1:K, 1:T, 1:L] >= 0.)
        JuMP.@variable(œÖ, œÅ[1:K, 1:T, 1:G] >= 0.)
        JuMP.@variable(œÖ, œ±[1:K, 1:T] >= 0.)
        JuMP.@variable(œÖ, œ±sq[1:K, 1:T])
        JuMP.@variable(œÖ, p[1:K, 0:T, 2:G])
        JuMP.@variable(œÖ, psq[1:K, 1:T, 2:G])
        JuMP.@variable(œÖ, œï[1:K, 1:T, 2:G] >= 0.)
    end
    for (k, (Y, Z)) in enumerate(YZcrew)
        JuMP.@constraint(œÖ, [t = 1:T, w in 1:W], œñ[k, t, w] - W‚Ñ∂["MAX"][w] * Y[t, w] <= 0.)
        JuMP.@constraint(œÖ, [t = 1:T, l in 1:L], Œ∂[k, t, l] - L‚Ñ∂["MAX"][l] * Z[t, l] <= 0.)
        JuMP.@constraint(œÖ, [t = 1:T], [œ±sq[k, t] + 1, œ±sq[k, t] - 1, 2 * œ±[k, t]] in JuMP.SecondOrderCone()) # üçß
        [ JuMP.fix(p[k, 0, g], G‚Ñ∂["ZP"][g]; force = true) for k in 1:K, g in 2:G ]
        JuMP.@constraint(œÖ, [t = 1:T, g = 2:G], [psq[k, t, g] + 1, psq[k, t, g] - 1, 2 * p[k, t, g]] in JuMP.SecondOrderCone()) # üçß
        JuMP.@constraint(œÖ, [t = 1:T, g = 2:G], G‚Ñ∂["C2"][g] * psq[k, t, g] + G‚Ñ∂["C1"][g] * p[k, t, g] + G‚Ñ∂["C0"][g] - (1. - x[t, g]) * Œ∏(g, G‚Ñ∂["PS"][g]) - œï[k, t, g] <= 0.)
        JuMP.@constraint(œÖ, [t = 1:T, g = 2:G], -G‚Ñ∂["RD"][g] * x[t, g] - G‚Ñ∂["SD"][g] * v[t, g] + p[k, t-1, g] - p[k, t, g] <= 0.)
        JuMP.@constraint(œÖ, [t = 1:T, g = 2:G], p[k, t, g] - p[k, t-1, g] - G‚Ñ∂["RU"][g] * x[t-1, g] - G‚Ñ∂["SU"][g] * u[t, g] <= 0.)
        JuMP.@constraint(œÖ, [t = 1:T], SRD - sum(œÅ[k, t, :]) <= 0.)
        JuMP.@constraint(œÖ, [t = 1:T], œ±[k, t] + œÅ[k, t, 1] - G‚Ñ∂["PS"][1] <= 0.)
        JuMP.@constraint(œÖ, [t = 1:T, g = 2:G], G‚Ñ∂["PI"][g] * x[t, g] - p[k, t, g] <= 0.)
        JuMP.@constraint(œÖ, [t = 1:T, g = 2:G], p[k, t, g] + œÅ[k, t, g] - G‚Ñ∂["PS"][g] * x[t, g] <= 0.)
        JuMP.@constraint(œÖ, [t = 1:T, b = 1:B], -B‚Ñ∂["BC"][b] <= sum(F[b, W‚Ñ∂["n"][w]] * (W‚Ñ∂["MAX"][w] * Y[t, w] - œñ[k, t, w]) for w in 1:W) + 
            sum(F[b, G‚Ñ∂["n"][g]] * p[k, t, g] for g in 2:G)
            - sum(F[b, L‚Ñ∂["n"][l]] * (L‚Ñ∂["MAX"][l] * Z[t, l] - Œ∂[k, t, l]) for l in 1:L) <= B‚Ñ∂["BC"][b])
        JuMP.@constraint(œÖ, [t = 1:T], sum(W‚Ñ∂["MAX"][w] * Y[t, w] - œñ[k, t, w] for w in 1:W) + sum(p[k, t, :]) + œ±[k, t] == sum(L‚Ñ∂["MAX"][l] * Z[t, l] - Œ∂[k, t, l] for l in 1:L))
        JuMP.@constraint(œÖ, Œ± + ip(Y, Œ≤Y) + ip(Z, Œ≤Z) >=
            sum(W‚Ñ∂["CW"][w] * œñ[k, t, w] for t in 1:T, w in 1:W) 
            + sum(L‚Ñ∂["CL"][l] * Œ∂[k, t, l] for t in 1:T, l in 1:L) 
            + sum(G‚Ñ∂["CR"][g] * œÅ[k, t, g] for t in 1:T, g in 1:G) 
            + sum(G‚Ñ∂["C2"][1] * œ±sq[k, t] + G‚Ñ∂["C1"][1] * œ±[k, t] for t in 1:T) 
            + sum(œï[k, :, :])
        ) # üìö pertaining to obj[k]
    end
    JuMP.set_attribute(œÖ, "DualReductions", 0)
    JuMP.optimize!(œÖ)
    status = JuMP.termination_status(œÖ)
    if status == JuMP.DUAL_INFEASIBLE
        JuMP.set_lower_bound(objterm, -333.333)
        JuMP.optimize!(œÖ)
        status = JuMP.termination_status(œÖ)
    end
    if status != JuMP.OPTIMAL
        error("in master_plus_RCYZ, status = $status")
    end
    return JuMP.value(objterm), JuMP.value(Œ±), JuMP.value.(Œ≤Y), JuMP.value.(Œ≤Z), JuMP.value.(u), JuMP.value.(v), JuMP.value.(x)
end

function subproblem_RCYZ(Œ±, Œ≤Y, Œ≤Z, u, v, x)
    function my_callback_function(cb_data, cb_where::Cint)
        if cb_where == Gurobi.GRB_CB_MIPSOL
            Gurobi.load_callback_variable_primal(cb_data, cb_where)
            vio_val = JuMP.callback_value.(cb_data, VIO_VAL)
            if vio_val > .5
                Gurobi.GRBterminate(JuMP.backend(œÖ)) 
                return nothing
            end
        end
        return nothing
    end
    œÖ = JumpModel(2)
    JuMP.@variable(œÖ, 0. <= Y[1:T, 1:W] <= 1.)
    JuMP.@variable(œÖ, 0. <= Z[1:T, 1:L] <= 1.)
    if true # dual system of f(‚ãÖ)
        JuMP.@variable(œÖ, ‚Ñµœñ[1:T, 1:W] >= 0.)
        JuMP.@variable(œÖ, ‚ÑµŒ∂[1:T, 1:L] >= 0.)
        JuMP.@variable(œÖ, ‚Ñµœï[1:T, 2:G] >= 0.)
        JuMP.@variable(œÖ, ‚Ñµdpl[1:T, 2:G] >= 0.)
        JuMP.@variable(œÖ, ‚Ñµdpr[1:T, 2:G] >= 0.)
        JuMP.@variable(œÖ, ‚ÑµSRD[1:T] >= 0.)
        JuMP.@variable(œÖ, ‚Ñµœ±[1:T] >= 0.)
        JuMP.@variable(œÖ, ‚ÑµPI[1:T, 2:G] >= 0.)
        JuMP.@variable(œÖ, ‚ÑµPS[1:T, 2:G] >= 0.)
        JuMP.@variable(œÖ, ‚Ñµbalance[1:T])
        JuMP.@variable(œÖ, ‚Ñµlfl[1:T, 1:B] >= 0.)
        JuMP.@variable(œÖ, ‚Ñµlfr[1:T, 1:B] >= 0.)
        JuMP.@variable(œÖ, ‚ÑµQ11[1:T])
        JuMP.@variable(œÖ, ‚ÑµQ12[1:T])
        JuMP.@variable(œÖ, ‚ÑµQ13[1:T])
        JuMP.@variable(œÖ, ‚ÑµQ21[1:T, 2:G])
        JuMP.@variable(œÖ, ‚ÑµQ22[1:T, 2:G])
        JuMP.@variable(œÖ, ‚ÑµQ23[1:T, 2:G])
        JuMP.@expression(œÖ, supobj, -sum(B‚Ñ∂["BC"][b] * (‚Ñµlfl[t, b] + ‚Ñµlfr[t, b]) for b in 1:B, t in 1:T) 
            +sum(
                (‚Ñµlfl[t, b] - ‚Ñµlfr[t, b]) * (sum(F[b, L‚Ñ∂["n"][l]] * L‚Ñ∂["MAX"][l] * Z[t, l] for l in 1:L) - sum(F[b, W‚Ñ∂["n"][w]] * W‚Ñ∂["MAX"][w] * Y[t, w] for w in 1:W))
                    for b in 1:B, t in 1:T
                )
            -sum(‚Ñµœñ[t, w] * (W‚Ñ∂["MAX"][w] * Y[t, w]) for w in 1:W, t in 1:T)
            -sum(‚ÑµŒ∂[t, l] * (L‚Ñ∂["MAX"][l] * Z[t, l]) for l in 1:L, t in 1:T)
            +sum(‚ÑµQ12[t] - ‚ÑµQ11[t] for t in 1:T)
            +sum(‚ÑµQ22[t, g] - ‚ÑµQ21[t, g] for g in 2:G, t in 1:T)
            +sum(‚Ñµœï[t, g] * (G‚Ñ∂["C0"][g] - (1 - x[t, g]) * Œ∏(g, G‚Ñ∂["PS"][g])) for g in 2:G, t in 1:T)
            +SRD * sum(‚ÑµSRD)
            -G‚Ñ∂["PS"][1] * sum(‚Ñµœ±)
            +sum(G‚Ñ∂["ZP"][g] * (‚Ñµdpl[1, g] - ‚Ñµdpr[1, g]) for g in 2:G)
            +sum(‚Ñµdpl[t, g] * (-G‚Ñ∂["RD"][g] * x[t, g] - G‚Ñ∂["SD"][g] * v[t, g]) for g in 2:G, t in 1:T)
            +sum(‚Ñµdpr[t, g] * (-G‚Ñ∂["RU"][g] * x[t-1, g] - G‚Ñ∂["SU"][g] * u[t, g]) for g in 2:G, t in 1:T)
            +sum(G‚Ñ∂["PI"][g] * x[t, g] * ‚ÑµPI[t, g] for g in 2:G, t in 1:T)
            +sum(‚Ñµbalance[t] * (sum(W‚Ñ∂["MAX"][w] * Y[t, w] for w in 1:W) - sum(L‚Ñ∂["MAX"][l] * Z[t, l] for l in 1:L)) for t in 1:T)
            -sum(G‚Ñ∂["PS"][g] * x[t, g] * ‚ÑµPS[t, g] for g in 2:G, t in 1:T)
        )
        JuMP.@expression(œÖ, expr1[t = 1:T, g = 2:G], sum(F[b, G‚Ñ∂["n"][g]] * (‚Ñµlfr[t, b] - ‚Ñµlfl[t, b]) for b in 1:B) 
            + G‚Ñ∂["C1"][g] * ‚Ñµœï[t, g] - 2 * ‚ÑµQ23[t, g] + (‚Ñµdpr[t, g] - ‚Ñµdpl[t, g]) + (‚ÑµPS[t, g] - ‚ÑµPI[t, g]) + ‚Ñµbalance[t])
        JuMP.@constraint(œÖ, p_T[g = 2:G], expr1[T, g] == 0.)
        JuMP.@constraint(œÖ, p[t = 1:T-1, g = 2:G], expr1[t, g] + (‚Ñµdpl[t+1, g] - ‚Ñµdpr[t+1, g]) == 0.)
        JuMP.@constraint(œÖ, psq[t = 1:T, g = 2:G], -‚ÑµQ21[t, g] - ‚ÑµQ22[t, g] + G‚Ñ∂["C2"][g] * ‚Ñµœï[t, g] == 0.)
        JuMP.@constraint(œÖ, œï[t = 1:T, g = 2:G], 1. - ‚Ñµœï[t, g] >= 0.)
        JuMP.@constraint(œÖ, œÅ_1[t = 1:T], G‚Ñ∂["CR"][1] - ‚ÑµSRD[t] + ‚Ñµœ±[t] >= 0.)
        JuMP.@constraint(œÖ, œÅ[t = 1:T, g = 2:G], G‚Ñ∂["CR"][g] - ‚ÑµSRD[t] + ‚ÑµPS[t, g] >= 0.)
        JuMP.@constraint(œÖ, œ±[t = 1:T], G‚Ñ∂["C1"][1] - 2 * ‚ÑµQ13[t] + ‚Ñµœ±[t] + ‚Ñµbalance[t] >= 0.)
        JuMP.@constraint(œÖ, œ±sq[t = 1:T], G‚Ñ∂["C2"][1] - ‚ÑµQ11[t] - ‚ÑµQ12[t] == 0.)
        JuMP.@constraint(œÖ, œñ[t = 1:T, w = 1:W], ‚Ñµœñ[t, w] + W‚Ñ∂["CW"][w] - ‚Ñµbalance[t] + sum(F[b, W‚Ñ∂["n"][w]] * (‚Ñµlfl[t, b] - ‚Ñµlfr[t, b]) for b in 1:B) >= 0.)
        JuMP.@constraint(œÖ, Œ∂[t = 1:T, l = 1:L], ‚ÑµŒ∂[t, l] + L‚Ñ∂["CL"][l] + ‚Ñµbalance[t] + sum(F[b, L‚Ñ∂["n"][l]] * (‚Ñµlfr[t, b] - ‚Ñµlfl[t, b]) for b in 1:B) >= 0.)
        JuMP.@constraint(œÖ, [t = 1:T], [‚ÑµQ11[t], ‚ÑµQ12[t], ‚ÑµQ13[t]] in JuMP.SecondOrderCone()) # üçß
        JuMP.@constraint(œÖ, [t = 1:T, g = 2:G], [‚ÑµQ21[t, g], ‚ÑµQ22[t, g], ‚ÑµQ23[t, g]] in JuMP.SecondOrderCone()) # üçß
    end
    JuMP.@expression(œÖ, VIO_VAL, supobj - ip(Y, Œ≤Y) - ip(Z, Œ≤Z) - Œ±)
    JuMP.@objective(œÖ, Max, VIO_VAL)
    JuMP.MOI.set(œÖ, Gurobi.CallbackFunction(), my_callback_function)
    # JuMP.unset_silent(œÖ)
    JuMP.optimize!(œÖ) # with callback
    status = JuMP.termination_status(œÖ)
    if status ‚àâ [JuMP.OPTIMAL, JuMP.INTERRUPTED]
        error("in master_plus_RCYZ, status = $status")
    end
    JuMP.value(VIO_VAL), JuMP.value.(Y), JuMP.value.(Z)
end

